 * @return boolean
 */
function pingAddress($address) {
    $status = -1;
    if (strcasecmp(PHP_OS, 'WINNT') === 0) {
        // Windows 服务器下
        $pingresult = exec("ping -n 1 {$address}", $outcome, $status);
    } 
    if (0 == $status) {
        $status = true;
    } else {
        $status = false;
    }
    return $status;
}

